import { useState } from "react";

// Define text input for links
export default function UrlInput() {
	const [url, setUrl] = useState("");

	// Define function for action upon press
	async function submitSong() {
		if (!url.trim()) return;
		console.log(url);
		setUrl("");
	}

	// Update the value of the url every time it's changed
	function updateText(e) {
		setUrl(e.target.value);
	}

	function handleKeyDown(e) {}

	return (
		<div className="Song-Input">
			<input
				className="URL-Input"
				name="SoundCloud URL Input"
				placeholder="Enter SoundCloud URL..."
				value={url}
				onChange={updateText}
			/>
			<button className="Hammer-Button" type="button" onClick={submitSong}>
				HAMMER
			</button>
		</div>
	);
}
